import React from 'react'

type CustomerListProps = {
    customers: any[]
}

export const CustomerList: React.FC<CustomerListProps> = ({customers}) => {
    return (
        <table>
        <thead>
          <tr>
              <th>Name</th>
              <th>Item Name</th>
              <th>Item Price</th>
          </tr>
        </thead>
        <tbody>
            {customers.map(customer => {
                    return (
                      <tr>
                        <td>Alvin</td>
                        <td>Eclair</td>
                        <td>$0.87</td>
                      </tr>
                    )
                })
            }
        </tbody>
      </table>
    )
}
